def solve(lst, tup):
    count_dict = {}

    for i in lst:
        count = 0
        for j in tup:
            if i == j:
                count += 1
        count_dict[i] = count

    return count_dict

def solve(list, tuple):
    count_dict = {}
    for element in list:
        count_dict[element] = tuple.count(element)
    return count_dict
